import { createBrowserRouter } from "react-router-dom";

import Menu from './Components/Header/Menu';
import Invoice from './Components/Invoice';
import Login from './Components/Login';
import Visualiser from "./Components/Visualiser/Visualiser";
import Suivi from "./Components/Suivi/Suivi";
import GestionCompte from "./Components/GestionComptes/GestionCompte";

const HomePage = () => <p>Hi from HomePage</p>;
const LoginPage = () => <p>Hi from Login</p>;
const RegisterPage = () => <p>Hi from Register</p>;
const UsersPage = () => <p>Hi from Users</p>;

    export const router = createBrowserRouter([
    {
        path: '/',
        element: <Login />
    },
    {
        path: '/login',
        element: <Visualiser />
    },
    {
        path: '/register',
        element: <Suivi />
    },
    {
        path: '/users',
        element: <GestionCompte />
    },
]);
